import{createInstance}from"../keyword/create-instance.min.js";import{Buildable}from"../interface/buildable.min.js";import{QualificationModel}from"../model/qualification-model.min.js";import{Utility}from"../shared/utility.min.js";import{PageColorAdjuster}from"../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../shared/script-series-loader.min.js";class QualificationController extends Buildable{constructor(){super(),this.model=new QualificationModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js","JQuery"),this.scriptLoader.load()}static build=async()=>{const i=new QualificationController;for(;i.scriptLoader.running;)await Utility.sleep(2e3);return i};execute=async()=>{const i=this.model.getQualifications();for(const e of i)$("div#qualification").append(`<p>${e.name} ${e.score}</p>`);(await createInstance(PageColorAdjuster)).changeBackgroundColor()}}export{QualificationController};